import logo from "./logo.svg";
import "./App.css";
import { useState } from "react";

function App() {
  const [recipe, setRecipe] = useState({});
  return (
    <div className="App">
      <form>
        <div>
          <input type="text" />
          <input type="number" />
        </div>
      </form>
      );
    </div>
  );
}

export default App;
